import { AppBar, Box, CssBaseline, ThemeProvider, Toolbar, Typography, createTheme } from '@mui/material';
import './styles.css';

const defaultTheme = createTheme();

export function Header() {
    return(
        <>
        <ThemeProvider theme={defaultTheme}>
            <Box sx={{ display: 'flex' }}>
                <AppBar>
                        <Typography
                            component="h1"
                            variant='h6'
                            color='inherit'
                            noWrap
                            sx={{ flexGrow: 1 }}
                        >
                            App Name
                        </Typography>
                </AppBar>
            </Box>
        </ThemeProvider>
        </>
    )
}
